      "vtp_html":"  \u003Cscript type=\"application\/ld+json\"\u003E\n    {\n      \"@context\": \"https:\/\/schema.org\",\n      \"@type\": \"FAQPage\",\n      \"mainEntity\": [{\n        \"@type\": \"Question\",\n        \"name\": \"bateria? pojemność baterii wydaje się dość mała, jak to wygląda w praktyce? przywykłem do 4000 mAh w redmi note 5; a tu 700 mAh mniej i dużo mocniejsze podzespoły... ?\",\n        \"acceptedAnswer\": {\n          \"@type\": \"Answer\",\n          \"text\": \"Telefon na testach trzyma podobnie baterię jak s10, wiadomo nie jest to taka sama pojemność, ale telefon ma bardzo oszczędny procesor. Zobacz sobie na youtube porównanie baterii.\"\n        }\n      }, {\n        \"@type\": \"Question\",\n        \"name\": \"Cena na ceneo jest 2099, a na stronie 2149 zł. Jeszcze telefon nie trafił do sprzedaży a już oszustwo na cenie.\",\n        \"acceptedAnswer\": {\n          \"@type\": \"Answer\",\n          \"text\": \"Czasem jak telefon jest z dystrybucji Europejskiej to cena się różni.\"\n\t\t}\n\t  }, {\n        \"@type\": \"Question\",\n        \"name\": \"Czy jesli zamówiłbym w czwartek około godziny 17, byłaby możliwość dostarczenia w piątek? Jeśli nie jaki byłby najbliższy termin dostawy?\",\n        \"acceptedAnswer\": {\n          \"@type\": \"Answer\",\n          \"text\": \"W naszym sklepie zamówienia złożone do 12.30 wysyłamy tego samego dnia (roboczego). Czas dostawy przez kuriera to 1-2 dni robocze.\"\n        }\n       }, {\n        \"@type\": \"Question\",\n        \"name\": \"Co znajduje sie w zestawie telefonu?\",\n        \"acceptedAnswer\": {\n          \"@type\": \"Answer\",\n          \"text\": \"Gdyby ktoś był jeszcze ciekawy odpowiadam: Przeźroczyste etui, kluczyk do karty sim, instrukcje, ładowarka. NIE ma słuchawek w zestawie.\"\n\t\t  }\n        }, {\n        \"@type\": \"Question\",\n        \"name\": \"Czy telefon jest wodo odporny, czy można robić zięcia pod woda?\",\n        \"acceptedAnswer\": {\n          \"@type\": \"Answer\",\n          \"text\": \"Witaj. W żadnym wypadku. Nie wolno pozwalać, aby telefon miał styczność z wilgocią\"\n        }\n       }\n     ]}\n    \u003C\/script\u003E",
